import './formInput.css';

const FormInput = (props) => {
  return (
    <>
      <div className="formInput">
        {/* <lable>Username</lable> */}
        <input
          placeholder={props.placeholder}
          onChange={(e) => props.setUserName(e.target.value)}
        />
      </div>
    </>
  );
};

export default FormInput;
